import React from 'react'

export default function ControlSidebar() {
  return (
    <div>
      <aside className="control-sidebar control-sidebar-dark">
        <div className="p-3">
          <h5>Title</h5>
          <p>Sidebar content</p>
        </div>
      </aside>
    </div>
  )
}
